                    $this->creator,
                    'anyOf(anyOf(string,LoginsResponse),null)'
                );
        }
        if (isset($this->modifier)) {
            $json['modifier']            = $this->modifier;
        }
        if (isset($this->login)) {
            $json['login']               =
                ApiHelper::getJsonHelper()->verifyTypes(
                    $this->login,
                    'anyOf(anyOf(string,LoginsResponse),null)'
                );
        }
        if (isset($this->account)) {
            $json['account']             =
                ApiHelper::getJsonHelper()->verifyTypes(
