                    'anyOf(anyOf(string,AccountsResponse),null)'
                );
        }
        if (isset($this->entity)) {
            $json['entity']              =
                ApiHelper::getJsonHelper()->verifyTypes(
                    $this->entity,
                    'anyOf(anyOf(string,EntitiesResponse),null)'
                );
        }
        if (isset($this->billing)) {
            $json['billing']             =
                ApiHelper::getJsonHelper()->verifyTypes(
                    $this->billing,
                    'anyOf(anyOf(string,BillingsResponse),null)'
                );
