        }
        if (isset($this->schedule)) {
            $json['schedule']            = PayoutScheduleEnum::checkValue($this->schedule);
        }
        if (isset($this->scheduleFactor)) {
            $json['scheduleFactor']      = $this->scheduleFactor;
        }
        if (isset($this->start)) {
            $json['start']               = $this->start;
        }
        if (!empty($this->currency)) {
            $json['currency']            = CurrencyEnum::checkValue($this->currency['value']);
        }
        if (isset($this->um)) {
            $json['um']                  = PayoutUmEnum::checkValue($this->um);
        }
        if (isset($this->amount)) {
            $json['amount']              = $this->amount;
        }
        if (isset($this->minimum)) {
